import nebula from './assets/nebula.png';
import viamo from './assets/viamo.jpg';
import './App.css';

function App() {
  return (
    <div>
        <h2>Bienvenidos</h2>
        <img 
          src={nebula} 
          alt='nebula'>
        </img>
        <img src={viamo} alt='viamo'></img>
    </div>
  );
}

export default App;
